import GridLayout from 'react-grid-layout';
import React, { Component, useMemo, useState, useEffect } from "react";

import Table from "./table.js";
import "./court-case.css";
import { AgGridColumn, AgGridReact } from 'ag-grid-react';

import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-alpine.css';

export default class DispCIN extends Component {
    constructor(props) {
        super(props);
        //Details of the Court Case
        if (props.cin_list == null) {
            this.state = {
                cin_list_data: [{ cin: "1", crime_type: "Theft" }, { cin: "2", crime_type: "theft" }],
                selected_cin: ""
            }
        }
        else {
            try {
                this.state = {
                    cin_list_data: props.cin_list_data,
                    selected_cin: ""
                };

            } catch (error) {
                console.log("Error in Getting Case Data");
            }

        }

    }
    render() {
        return (
            <div className="ag-theme-alpine" style={{ height: 100, width: 600 }}>
                <AgGridReact
                    rowData={this.state.cin_list_data}>
                    <AgGridColumn field="cin"></AgGridColumn>
                    <AgGridColumn field="crime_type"></AgGridColumn>                    
                </AgGridReact>
            </div>
        );

    }
}
